using System;
using Nancy.ErrorHandling;
using Nancy;
using System.IO;
using System.Text;

namespace Jarvis
{
  public class StatusCodeHandler : IStatusCodeHandler
  {
    private readonly string rootPath;

    public StatusCodeHandler(IRootPathProvider rootPathProvider)
    {
      rootPath = rootPathProvider.GetRootPath();
    }

    public bool HandlesStatusCode(HttpStatusCode statusCode, NancyContext context)
    {
      bool result = false;

      switch (statusCode)
      {
        case HttpStatusCode.NotFound:
        case HttpStatusCode.InternalServerError:
          result = true;
          break;

        default:
          result = false;
          break;
      }

      return result;
      //return statusCode == HttpStatusCode.InternalServerError;
//      return statusCode == HttpStatusCode.NotFound;
    }

    public void Handle(HttpStatusCode statusCode, NancyContext context)
    {
      StringBuilder responseText = new StringBuilder();

      switch (statusCode)
      {
        case HttpStatusCode.InternalServerError:
          responseText.AppendFormat("<img style='display: block; margin: auto;' src='data:image/png;base64,{0}' /><br />", Utilities.ConvertToBase64(rootPath + "/Content/error.png"));
          responseText.Append("<p>I'm sorry sir, it appears I have malfunctioned...<br />");
          responseText.Append("Please send this text to my creator.<br /><br />");
          responseText.Append("Error message:<br />" + Utilities.ToHtmlEncoding(context.Items["ERROR_TRACE"].ToString()));
          responseText.Append("</p>");
          break;

        case HttpStatusCode.NotFound:
          responseText.Append(Get404());
          break;

        default:
          responseText.Append("I don't have a response for that.");
          break;
      }

      context.Response.Contents = stream =>
      {
        using (StreamWriter writer = new StreamWriter(stream))
        {
          writer.Write(responseText.ToString());
        }
      };
    }

    private string Get404()
    {
      return @"<html><head>
  <meta charset='utf-8'>
<title>Jarvis</title>

<style type='text/css'>
  body
  {
    background-color: black;
    color: white;
  }

  p, h3
  {
    font-family: Courier;
    margin-left: 35px;
    margin-top: 5px;
    margin-bottom: 5px;
  }

  h1, h2
  {
    font-family: Courier;
  }

 
</style>
</head>
<body>
  <a href='/'><img src='/Content/jarvis.png' alt='Jarvis logo' style='vertical-align: middle;'></a>
  <br />
  <div style='position: absolute; top:0; right:0;'>
    <a href='/help'>
      <img src='/Content/help.png' alt='Help'>
    </a>
  </div>
  <br />
  <br />
  <br />
  <img style='display: block; margin: auto;' src='data:image/png;base64,'>
  <h3 style='text-align: center;'>[404] File Not Found</h3>
</body></html>";
    }
  }
}

